function load(side, turn) {
  $(`#${side}-board > .arrow`).remove()
  $(`#${side}-board`).html(board(side == "white" ? white_diagrams[turn - 1] : black_diagrams[turn - 1]))
}

load("white", 1)
load("black", 1)

$("#white-turn")
  .attr("max", white_diagrams.length)
  .change(e => load("white", e.target.value))
$("#black-turn")
  .attr("max", black_diagrams.length)
  .change(e => load("black", e.target.value))